import React from "react";
import ResumeItem from "./components/ResumeItem";
import { Container, Button, Row, Col } from "react-bootstrap";

const Resume = () => (
  <Container>
    <h1>Resume</h1>
    <p>Hello</p>
    <ResumeItem
        heading="Education"
        title="Stanford University / Expected Graduation: June 2024 "
        subhead="Stanford, CA / 2019 - Present"
        text="B.S. Computer Science (HCI), B.A. Psychology, GPA: 3.8 out of 4.0."
        text2="Organizations: Stanford Women in Design, Tech History Project, The Stanford Daily, Stanford Culture & Emotion Lab, Stanford Open Data Project, Associated Students of Stanford University, Tech History Project"
      />
          <hr />
  </Container>
);

export default Resume;
